import React from 'react';
import Header from './componentes/Header';
import Footer from './';
import ProductGrid from './componentes/ProductGrid';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <ProductGrid />
      <Footer />
    </div>
  );
}

export default App;
